import React from "react";
import Container from "../../layout/container/container";
import LinkNavigation from "./LinkNavigation";
import Overlay from "../Overlay/Overlay";
import ReactDOM from "react-dom";
import Section from "../Section/Section";
import Wave from "./Wave";
import {useSelector, useDispatch} from 'react-redux';
import { layoutActions } from "../redux-store/Store";
const Navigation = () => {
  const isClicked = useSelector(state => state.layout.isClicked);
  const dispatch = useDispatch();
  const toggleHandler = () => {
    dispatch(layoutActions.toggleLayout());
  };
  return (
    <Container>
      <LinkNavigation toggle={toggleHandler} transform={isClicked} />
      <Section />
      {isClicked &&
        ReactDOM.createPortal(
          <Overlay layout={toggleHandler} />,
          document.getElementById("overlay")
        )}
        <Wave/>
    </Container>
  );
};

export default Navigation;
